import React from "react";
import "./css/Portfolio.css";

export default function PortfolioBox({ key, name, date, description, techs, picture, url }) {

    return (
        <div className="PortfolioBox-wrapper" key={key}>
            <div className="PortfolioBox-main-box">
                {name}
            </div>

            <div className="PortfolioBox-description-box">
                {date}
                {description}
                {techs}
                <a href={url} target="new">visit</a>
            </div>
        </div>
    )
};
